	<script>
		$("i").on("click", function(){
			let t = $(this).attr("title");
			$("p").prepend(t + " ");
		});
		$("#p").on("click", function(){
			$("p").text("");
			$("input").val("");
		});
		var icon = $("i");
		$("input").on("input", function(){
			var regPhrase = new RegExp($(this).val(), 'i');
			for (var i = 1; i < icon.length; i++) {
				if (regPhrase.test(icon[i].title)) {icon[i].style.display = "";}
				else {icon[i].style.display = "none";}
			}
		});
	</script>
